# 1) შექმენით ფუნქცია რომელსაც გადმოეცემა ორი მოთამაშის არჩეული მოძრაობა ( rock, paper, scissors ) და აბრუნებს რომელმა მოიგო
# 2) შექმენით ფუნქცია რომელსაც გადმოეცემა ორი მასივი სამ სამი ელემენტით. პირველი მოთამაშის [ძალა, სისწრაფე, ინტელიგენტი] და მეორე მოთამაშის [ძალა, სისწრაფე, ინტელიგენტი]. თქვენი მიზანია დაადგინოთ რომელი მოიგებს - ძალა არის 1 ქულა, სისწრაფე 2 ხოლო ინტელიგენტი ამ ორის ჯამს ამრავლებს თავის თავი გაყოფილი 10-ზე.